function Catalog() {
  return (
    <div className="max-w-7xl mx-auto flex text-center bg-gray-900 ">
      <div className="block basis-1/5 border-2 border-black">Catalog</div>
      <div className="block basis-3/5 border-2 border-black">Ad</div>
      <div className="block basis-1/5 border-2 border-black">Ad</div>
    </div>
  );
}

export default Catalog;
